import React from 'react';

const Profile = () => {
  return (
    <div className="content">
      <div>
        <img src="https://www.w3schools.com/css/img_5terre.jpg" alt="pelican" />
      </div>
      <div>ava+description</div>
      <div>My post</div>
      <div>post 1</div>
      <div>post 2</div>
    </div>
  );
};

export default Profile;
